import React from 'react'
import Employes from './Employes';
import { useState } from 'react';
import { dataes } from './data';
 const EmployeeLists = () => {
const [employ, setEmploy] = useState(dataes)
  return (
    <React.Fragment>
<div className="table-title">
	<div className="row">
		<div className="col-sm-6">
						<h2>Manage <b>Employees</b></h2>
					</div>
					<div class="col-sm-6">
						<a href="#addEmployeeModal" className="btn btn-success" data-toggle="modal"><i class="material-icons">&#xE147;</i> <span>Add New Employee</span></a>					
		        </div>
		</div>
</div>
<table class="table table-striped table-hover">
				<thead>
					<tr>
						<th>Name</th>
						<th>Email</th>
						<th>Address</th>
						<th>Phone</th>
						<th>Actions</th>
					</tr>
				</thead>
				<tbody>
					<tr>
                        {
                            employ.map((item)=>{
                                return(
                                    <tr>
 <Employes/>
                                    </tr>
                                )
                            })
                        }
                       
                    </tr>
                    </tbody>
                    </table>
                    </React.Fragment>
                   
  )
}
export default EmployeeLists;
